%angular

<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.7/leaflet.css" />
<div id="map" style="height: 800px; width: 100%"></div>

<script type="text/javascript">
function initMap() {
    var map = L.map('map', {scrollWheelZoom: false}).setView([37.09, -95.71], 5);

    L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
        attribution: 'Map data &copy; <a href="https://openstreetmap.org">OpenStreetMap</a> contributors',
        maxZoom: 12,
        minZoom: 2
    }).addTo(map);

    var geoMarkers = L.layerGroup().addTo(map);

    var airports = angular.element("#map").scope().compiledScope.airports;

    console.log("Airports? %o", airports);

    airports.forEach(function(airport){
        // Marker
        L.marker([airport.values[2], airport.values[3]]).addTo(map).bindPopup("<b>"+airport.values[1]+"</b><br/>"+airport.values[0]).openPopup();
    });
}

if (window.locationWatcher) {
    // clear existing watcher otherwise we'll have duplicates
    window.locationWatcher();
}

// ensure we only load the script once, seems to cause issues otherwise
if (window.L) {
    initMap();
} else {
    console.log('Loading Leaflet library');
    var sc = document.createElement('script');
    sc.type = 'text/javascript';
    sc.src = 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.7/leaflet.js';
    sc.onload = initMap;
    sc.onerror = function(err) { alert(err); }
    document.getElementsByTagName('head')[0].appendChild(sc);
}
</script>

